<1359208ca11d7b4ca75e471fef578340>"a:2:{s:4:\"type\";s:21:\"PayplansPlanFormatter\";s:7:\"content\";a:11:{s:7:\"plan_id\";s:3:\"149\";s:5:\"title\";s:7:\"Premium\";s:9:\"published\";s:1:\"1\";s:7:\"visible\";s:1:\"1\";s:8:\"ordering\";s:2:\"87\";s:11:\"checked_out\";s:0:\"\";s:16:\"checked_out_time\";s:0:\"\";s:13:\"modified_date\";s:19:\"2022-11-23 18:53:38\";s:11:\"description\";s:853:\"<h5 class=\"uk-text-bold\">Regular Access<\/h5>\r\n<p class=\"uk-text-small\">Best value for regular use of our CPD resources (<span class=\"uk-text-primary\">save 50%<\/span>)<\/p>\r\n<hr \/>\r\n<p class=\"uk-text-small\">Our multi award-winning combination of live and on-demand online training:<\/p>\r\n<ul class=\"uk-list  uk-list-line uk-text-small\">\r\n<li>All our 'core', clinical and business management topics<\/li>\r\n<li>The current month's live webinar<\/li>\r\n<li>Track your learning and measure its impact on your patient care and career development<\/li>\r\n<\/ul>\r\n<hr \/>\r\n<p class=\"uk-text-small\">Access via desktop, laptop, tablet or phone<\/p>\r\n<hr \/>\r\n<p><a href=\"my-learning\/courses\" target=\"_blank\" rel=\"noopener noreferrer\">View course directory<\/a><\/p>\r\n<hr \/>\r\n<p class=\"uk-text-primary uk-text-small\">Renews automatically until cancelled (cancel via PayPal)<\/p>\";s:7:\"details\";s:220:\"{\"expirationtype\":\"recurring\",\"expiration\":\"000100000000\",\"recurrence_count\":\"0\",\"price\":\"24.99\",\"trial_price_1\":\"0.00\",\"trial_time_1\":\"000000000000\",\"trial_price_2\":\"0.00\",\"trial_time_2\":\"000000000000\",\"currency\":\"GBP\"}\";s:6:\"params\";s:511:\"{\"teasertext\":\"Continuous CPD access (cancel any time)\",\"redirecturl\":\"\\\/my-cpd\",\"badgeVisible\":\"1\",\"badgePosition\":\"right\",\"badgeTitle\":\"Recurring\",\"badgeTitleColor\":\"#526af0\",\"badgebackgroundcolor\":\"#eeeeee\",\"planHighlighter\":\"1\",\"limit_count\":\"\",\"scheduled\":\"\",\"start_date\":\"2021-08-23\",\"end_date\":\"2021-08-23\",\"total_count\":167,\"moderate_subscription\":\"\",\"parentplans\":\"\",\"displaychildplanon\":\"-2\",\"expiration_date\":\"2021-08-23\",\"subscription_from\":\"\",\"subscription_to\":\"\",\"enable_fixed_expiration_date\":\"\"}\";}}"</1359208ca11d7b4ca75e471fef578340>
<f8eb3ae575631d9b8c2e218303c61534>"a:2:{s:4:\"type\";s:25:\"PayplansAppEmailFormatter\";s:7:\"content\";a:3:{s:7:\"user_id\";s:4:\"7012\";s:7:\"subject\";s:29:\"Your Premium CPD Subscription\";s:4:\"body\";s:1083:\"<p>Dear RUHANI BHATIA,<\/p>\r\n<p>Thank you for subscribing to our Premium CPD subscription plan. This gives you access to our extensive library of CPD courses. In addition to those available on-demand, remember that you will also be able to join in our <a href=\"my-learning\/live-webinars\">Evening Expert webinars<\/a>, during which you will be able to meet with other like-minded professionals.<\/p>\r\n<p>New content is added regularly, so look out for the notifications on the site, our social media pages and our newsletter.<\/p>\r\n<p>This is a recurring subscription that will automatically renew each month until cancelled. You may cancel at any time whilst it is active by logging into your PayPal account and cancelling the payment. Please note that it cannot be cancelled directly from our website.<\/p>\r\n<p>I very much hope that you find our CPD service of great benefit and look forward to meeting you on-line.<\/p>\r\n<p>Regards,<\/p>\r\n<p>Andrew<\/p>\r\n<hr \/>\r\n<p>Andrew Gould<br \/> Founder, <a href=\"https:\/\/www.dental-channel.co.uk\/\">The Dental Channel<\/a><br \/>+44 (0)20 8299 9742<\/p>\";}}"</f8eb3ae575631d9b8c2e218303c61534>
